INSERT INTO `dialogos` VALUES (1,'Dialogo 1','griego','Ειρήνη: Γεια, με λένε Ειρήνη!\r\n\r\nΈφη: Γεια σου, Ειρήνη! Τι νέα;  //  (Expresión parecida al Τι κάνεις, “¿Qué hay de nuevo?”)\r\n\r\nΕιρήνη: Καλά, εσύ; Πώς σε λένε;\r\n\r\nΈφη: Με λένε Έφη!\r\n\r\nΕιρήνη: Και από πού είσαι;\r\n\r\nΈφη: Είμαι Ελληνίδα, από την Αθήνα!\r\n\r\nΕιρήνη: Α, μένεις δηλαδή στην Αθήνα;  //  (δηλαδή significa “es decir” o “entonces”)\r\n\r\nΈφη: Ναι, εγώ μένω στην Αθήνα. Εσύ, στη Θεσσαλονίκη;\r\n\r\nΕιρήνη: Όχι, στην Αθήνα και εγώ.  //  (και εγώ es una forma de decir “yo también”, literalmente es “y yo”)\r\n\r\nΈφη: Α, τέλεια!','2019-01-28 18:26:52','2019-01-28 18:26:52'),(2,'Dialogo 2','griego','Γεια σας, είμαι η Λία Παπαδάκη, και είμαι από Ελλάδα. Μένω στην Αθήνα, και έχω σπουδάσει Οικονομία και Διοίκηση Επιχειρήσεων.\r\n \r\n\r\nLia se presenta diciendo que es de Grecia también sin poner el artículo (Είμαι από την Ελλάδα). En la lengua coloquial muchas veces se omite, pero lo correcto es decirlo. También nos dice que ha estudiado Economía y Administración de Empresas.\r\n\r\n \r\n\r\nΔουλεύω ως DJ σε όλη την Ελλάδα, στην Ευρώπη, αλλά και εκτός Ευρώπης. Μιλάω πέντε γλώσσες, οι οποίες είναι Ελληνικά, Αγγλικά, Γερμανικά, Τουρκικά και Ισπανικά.\r\n \r\n\r\nLa frase σε όλη την Ελλάδα significa “en toda Grecia”, y αλλά και εκτός Ευρώπης significa “pero también fuera de Europa”. Finalmente, el οι οποίες significa “las cuales” (Habla 5 lenguas, las cuales son…)','2019-01-28 18:31:34','2019-01-28 18:31:34');
/*!40000 ALTER TABLE `dialogos` ENABLE KEYS */;
UNLOCK TABLES;

