INSERT INTO `notas` VALUES (1,'Adjetivos que terminan por -ος y hacen el femenino con -α en lugar de –η. Los adjetivos con estas terminaciones son aquellos cuya raíz termina en sonido i o en cualquier otra vocal acentuada. Por ejemplo, los adjetivos άγριος (salvaje), άδειος (vacío), δημόσιος (público), καινούργιος (nuevo), κρύος (frío).','griego',25,'2019-03-14 09:44:38','2019-03-14 09:44:38'),(3,'El adjetivo va antes que el sujeto/objeto.\r\n\r\nEj: Το πράσινο βιβλίο => El libro verde','griego',25,'2019-03-14 10:19:31','2019-03-14 10:19:31'),(4,'IMPORTANTE: Los adjetivos posesivos se escriben después del sustantivo.','griego',26,'2019-03-27 17:00:42','2019-03-27 17:00:42'),(5,'En griego existen tres géneros: masculino, femenino y neutro. En muchas ocasiones coinciden con el español, como en el caso de ‘ο δάσκαλος’ (el maestro), pero en otros casos puede ser distinto, como en ‘ο άνθρωπος’ (la persona). Por eso, cuando aprendas palabras nuevas, hazlo siempre con su artículo correspondiente (ο, η, το…).','griego',15,'2020-04-14 17:38:26','2020-04-14 17:38:26'),(6,'El artículo indefinido ένας/μια/ένα no tiene plural. Sin embargo, teniendo en cuenta que significa ‘un, una’, podríamos usar como plural μερικοί/μερικές/μερικά, que significa ‘varios, varias’:\r\n\r\nΈνας άνθρωπος (una persona) -> Μερικοί άνθρωποι (varias personas)\r\n\r\nΜία γλώσσα (una lengua) -> Μερικές γλώσσες (varias lenguas)\r\n\r\nΈνα βιβλίο (un libro) -> Μερικά βιβλία (varios libros)','griego',15,'2020-04-14 17:43:29','2020-04-14 17:43:29'),(7,'En el vídeo se menciona una regla de acentuación del griego moderno, y es que ninguna palabra puede estar acentuada más allá de la antepenúltima sílaba. Por tanto, si al hacer el plural se añade una sílaba extra (como en el caso de -ματα en neutro), el acento se debe desplazar una sílaba a la derecha para que se cumpla esta regla:\r\n\r\nΤο πρόβλημα – Τα προβλήματα\r\n\r\nΤο άγαλμα – Τα αγάλματα','griego',18,'2020-04-16 17:22:49','2020-04-16 17:22:49'),(8,'Ola ta lepta  -> frase que se utiliza para decir \"mola mucho\" o \"es la leche\"','griego',21,'2020-04-16 18:44:04','2020-04-16 18:44:04'),(9,'‘Es la una’ -> Είναι μία\r\n\r\n‘Son las tres’ -> Είναι τρεις\r\n\r\n‘Son las cuatro’ -> Είναι τέσσερις','griego',22,'2020-04-17 18:06:49','2020-04-17 18:06:49'),(10,'Como hemos dicho antes, la palabra ‘hora’ en griego es femenina (η ώρα) y por eso las ponemos en femenino: είναι μία, είναι τρεις, είναι τέσσερις…\r\n\r\nSin embargo, la palabra ‘minuto’ es neutra (το λεπτό), por lo que los minutos los diremos en neutro: είναι μία και τρία (no τρεις), είναι τρεις και τέσσερα (no τέσσερις)…','griego',22,'2020-04-17 18:08:15','2020-04-17 18:08:15'),(11,'(Σήμερα) είναι/έχουμε + día\r\nPara decir el día de la semana','griego',59,'2020-04-23 11:25:12','2020-04-23 11:25:12'),(12,'(Σήμερα) είναι/έχουμε + número del día en femenino \r\n(Para decir el número del día)','griego',59,'2020-04-23 11:25:38','2020-04-23 11:25:38'),(13,'(Σήμερα) είναι/έχουμε + número del día en femenino + mes en genitivo\r\n(Para decir el número del día y el mes)','griego',59,'2020-04-23 11:30:49','2020-04-23 11:30:49');
/*!40000 ALTER TABLE `notas` ENABLE KEYS */;
UNLOCK TABLES;

